import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


import { Provider } from 'react-redux'
import {storea} from './store'

ReactDOM.render(
    <Provider store={storea}>
    <App />
    </Provider>,
document.getElementById('root'))
